import timefrom spade.agent import Agentfrom spade.behaviour import OneShotBehaviourfrom spade.message import Messagefrom spade.template import Templateimport randomfrom utils.messaging import Messagingfrom constants.agents import Agentsimport pathlibimport sqlite3class Timetable(Agent):        class UserCameBehav(OneShotBehaviour):        userCame = False        async def run(self):                        self.userCame = self.check_if_user_came()                        if not self.userCame:                               print("UserCameBehav running")                                metadata = {"type": "UserAbsence"}                msg = Messaging.prepare_message(Agents.SUPERVISOR, "", **metadata)                                    await self.send(msg)                print("Message sent!")            # stop agent from behaviour            await self.agent.stop()                    def check_if_user_came(self):            userCame= random.choice([True, False])            #  print (userCame)                return False                       async def setup(self):        print("Calendar started")        b = self.UserCameBehav()        self.add_behaviour(b)                                                                                              